  true,\n\t\"url\": null,\n\t\"notes\": \"This report contains yearly electronic services
  data for online applications. This report is updated monthly for the current fiscal
  year. The report is divided into six main sections namely electronic access, My
  Social Security Suite, MySSA Help Desk-Call Back Request, Pre-Entitlement, Entitlement,
  and Post-Entitlement. This report contains data for online applications such as
  electronic access, Benefit Verification, Direct Deposit, Change of address, iClaim,
